import React from 'react'
// icons
import {MdEdit,MdDelete} from 'react-icons/md';


const ExpenseItem = ({expense, handleEdit, handleDelete }) => {
  const {id, charge, amount} = expense;
  return (
    <li className="item">
      <div className="info">
        <span classsName="expense">{charge}</span>
        <span className="amount">{amount} TL</span>
      </div>
      <div>
        <button className="edit-btn" aria-label="edit button" onClick={handleEdit}>
          <MdEdit />
        </button>
        <button className="clear-btn" aria-label="edit button" onClick={handleDelete}>
          <MdDelete />
        </button>
      </div>
    </li>
  )
}

export default ExpenseItem;
